import "./navbar.css";

export default function Navbar() {
    return(
        <div className="navbar">
            <div className="navbarWrapper">
                <div className="navbarLeft">
                    <div className="logo">
                        <div className="logoText">HOTDOC</div>
                        <div className="logoShape"></div>
                    </div>
                    <div className="logoHome">Home</div>
                </div>
            </div>
        </div>
    )

}
